import React, { useState } from "react";

function App() {
  const [attributes, setAttributes] = useState([]);

  const handleDrop = (event) => {
    event.preventDefault();
    const file = event.dataTransfer.files[0];
    if (file && file.type === "application/json") {
      const reader = new FileReader();
      reader.onload = (e) => {
        try {
          const json = JSON.parse(e.target.result);
          setAttributes(Object.keys(json));
        } catch (error) {
          console.error("Error parsing JSON", error);
        }
      };
      reader.readAsText(file);
    }
  };

  return (
    <div className="flex flex-col items-center justify-center h-screen bg-gray-100">
      <div
        onDragOver={(e) => e.preventDefault()}
        onDrop={handleDrop}
        className="w-80 h-48 border-4 border-dashed border-gray-300 flex items-center justify-center bg-white text-center cursor-pointer hover:border-gray-500 transition duration-300"
      >
        Drop your JSON file here
      </div>
      <div className="mt-6 text-gray-800">
        <h3 className="text-lg font-semibold">Attributes:</h3>
        <ul className="list-disc pl-5 mt-2">
          {attributes.map((attr, index) => (
            <li key={index}>{attr}</li>
          ))}
        </ul>
      </div>
    </div>
  );
}

export default App;
